import React from 'react';
// import UButton from './UButton';
// import Button from 'react-bootstrap/Button';

import BlackOutlined from './../static/images/extruder/Unite3D-extruder-purple-no-background.png'

export default class Unite3DLogo extends React.Component {

  render() {
    return (
      <img
        alt=""
        src={BlackOutlined}
        width="50"
        height="50"
        className="mr-2 d-inline-block align-top"
      />
    )
  }
}
